Не флиртую — я оттачиваю мастерство общения;
 Я не пью — я дегустирую;
 Я не ошибаюсь — я принимаю рискованные решения;
 Я не опаздываю — меня задерживают важные дела;
 Я не забываю — я не засоряю свою память излишней информацией;
 Я не лгу — я веду себя дипломатично;
 Я не боюсь — я поступаю предусмотрительно;
 Я не люблю сплетен — я просто выслушиваю мнения;
 Я не красива — я чертовски мила;
 Я не высокомерная — я брезглива;
 Я не язвительна — просто, говорю, что думаю;
 Я Вам не хамлю — я просто использую длинные слова;
 Я не теряю людей — Люди теряют Меня...
